import React from "react";
import "./Person.css";

const Person = (props) => {
  return (
    <div className="person">
      <p onClick={props.click}>My name is {props.person.name}</p>
      <p>I am {props.person.age} year old</p>
      <input
        className="outlin"
        type="text"
        onChange={(event) => {
          props.changeHandler(event, props.person);
        }}
        value={props.person.name}
      />
    </div>
  );
};

export default Person;
